import React, { useState, useEffect } from "react";
import "./App.css";
import Routes from "./Routes";
import axios from "axios";

const App = () => {
  const [test, setTest] = useState([]);

  useEffect(async () => {
    const response = await axios("http://127.0.0.1:8000/api/restaurant/");

    setTest(response.data.results);
  }, []);
  // async function testn() {
  //   const result = await axios.get("http://127.0.0.1:8000/api/restaurant/");
  //   console.log(result.data);
  //   setTest(result.data);
  // }
  return (
    <div>
      <Routes />

      {test.map((restaurant) => (
        <p>{restaurant.name}</p>
      ))}
    </div>
  );
};

export default App;
